import React from "react";
import "./custom-button.sty.scss";
import { CustomButtonContainer } from "./custom-button.sty";

const CustomButton = ({
  children,
  isGoogleSignin,
  inverted,
  ...otherProps
}) => {
  return <CustomButtonContainer>{children}</CustomButtonContainer>;
};

export default CustomButton;
